function is_email_valid(value)
{if(typeof(value)!=='string'){return false;}
if(value.indexOf('..')!==-1){return false;}
var matches=value.match(/^(.+)@([^@]+)$/);if(matches===null){return false;}
var localpart=matches[1];var hostname=matches[2];if(localpart.length>64||hostname.length>255){return false;}
if(localpart.match(/^[a-zA-Z0-9\x21\x23\x24\x25\x26\x27\x2a\x2b\x2d\x2f\x3d\x3f\x5e\x5f\x60\x7b\x7c\x7d\x7e]+(\x2e+[a-zA-Z0-9\x21\x23\x24\x25\x26\x27\x2a\x2b\x2d\x2f\x3d\x3f\x5e\x5f\x60\x7b\x7c\x7d\x7e]+)*$/)===null&&localpart.match(/^\x22([\x20\x09\x01-\x08\x0b\x0c\x0e-\x1f\x7f\x21\x23-\x5b\x5d-\x7e])*[\x20\x09]?\x22$/)===null){return false;}
return hostname.match(/^(?:[A-Z0-9]+(?:-*[A-Z0-9]+)*\.)+[A-Z]{2,6}$/i)!==null;}
function check_password()
{var password_field=$('#sdrive_user_password');var password=password_field.val();var password_message=$('#signup_password .status');if(password==''||password=='Password')
{password_field.removeClass('error good success lousy great');password_message.removeClass('error good success').addClass(noteClass).html('&nbsp;');}
else if(password.length>0)
{var className;var noteClass;var pwd_strength=0;pwd_strength=check_password_strength();if(pwd_strength<3){className='lousy';noteClass='error';}
if(pwd_strength==3||pwd_strength==4){className='good';}
if(pwd_strength>4){className='great';noteClass='success';}
message=className.charAt(0).toUpperCase()+className.slice(1);password_message.removeClass('error good success').addClass(noteClass).html(message+" password.");$('#sdrive_user_password').removeClass().addClass(className);$('#sdrive_user_password_error').fadeOut();}}
function check_password_strength()
{var password=$('#sdrive_user_password').val();var strength=0;if(password.length>=5){strength++;}
if(password.length>=8){strength++;}
if(password.length>=12){strength++;}
if(password.match(/[a-z]+/)){strength++;}
if(password.match(/[0-9]+/)){strength++;}
if(password.match(/[A-Z]+/)){strength++;}
if(password.match(/[\W]+/)){strength++;}
return strength;}
